import "./EsqueciSenha.css";
import React from "react";

export const EsqueciSenha = () => {
    // Função para manipular o evento de clique no botão "Cadastrar"
    const cadastrar = () => {
        console.log("Cadastrar clicado");
        // Adicione aqui a lógica para cadastrar
    };

    // Função para manipular o evento de clique no botão "Cancelar"
    const cancel = () => {
        console.log("Cancelar clicado");
        // Adicione aqui a lógica para cancelar
    };

    return (
        <div className="container">
            <div className="row">
                <div className="col-lg-12">
                    <div className="bs-component">
                        <button onClick={cadastrar} type="button" className="btn btn-success">
                            <i className="pi pi-save"></i> Cadastrar
                        </button>
                        <button onClick={cancel} type="button" className="btn btn-danger">
                            <i className="pi pi-cancel"></i> Cancelar
                        </button>
                    </div>
                </div>
            </div>
        </div>
    );
};
